import React, { useState } from 'react';
import { CustomInput, Label } from './styled';
import { useForm } from "react-hook-form";
const Component = React.forwardRef(({ label, isRequired, placeholder, type, ...rest }, ref) => (
    <CustomInput>
        <Label>{label}</Label>
        <input type={type} placeholder={placeholder || ""} isRequired={isRequired} {...rest} ref={ref} />
    </CustomInput>
)

)

export default Component;
export { Component as CustomInput };
